import axios from 'axios'

const Homepage = () => {

    axios.get('https://pokeapi.co/api/v2/pokemon/ditto')
        .then(res => {
            console.log(res.data)
        }) 

    return  (
        <h1>Homepage</h1>
    )
}

export default Homepage
